                profileImage={card.profileImage}
                title={card.title}
                priceRange={card.priceRange}
              />
            ))}
          </div>
        </div>

        {/* Second Row */}
        <div className="w-full">
          <div className="grid grid-cols-1 sm:grid-cols-2 xl:grid-cols-4 gap-[24px] xl:gap-[32px] justify-items-center">
            {cardsData2.map((card, index) => (
              <Card
                key={index}
                backgroundImage={card.backgroundImage}
                profileImage={card.profileImage}
                title={card.title}
                priceRange={card.priceRange}
